export const loginLbs = [
  {
    title: 'Username',
    type: 'text',
    name: 'username',
    value: this.state.credentials.username,
    handleChangeClb: this.handleChange
  },
  {
    title: 'Email',
    type: 'email',
    name: 'email',
    value: this.state.credentials.email,
    handleChangeClb: this.handleChange
  },
  {
    title: 'Password',
    type: 'password',
    name: 'password',
    value: this.state.credentials.password,
    handleChangeClb: this.handleChange
  }
]

export const registerLbs = [
  {}
]
